  \"2016-07-27T22:41:58.566747\",\n\t\"name\": \"effects-of-a-cattail-marsh-on-sediment-and-water-quality-of-the-laguna-atascosa-national-w\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The drainage known as the Cayo Atascosa
  transports irrigation return flow water through a cattail marsh and into Laguna
  Atascosa (Lake) located in Laguna Atascosa National Wildlife Refuge in Texas. Sediment
  and water samples were collected to determine the effectiveness of the marsh as
  a filter for contaminants. Results demonstrate that although organochlorines and
  metals are present in low concentrations in the sediment, the Cayo Atascosa acts
  as a sink for these contaminants. In addition, the cattail (Typha spp.) marsh behaves
  as a biofilter for excess nutrients from upstream, thus protecting water quality
  in the Laguna Atascosa.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
